eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   reviews: () => (/* binding */ reviews)\n/* harmony export */ });\nconst reviews = [\n    {\n        name: \"Martyna\",\n        stars: 5,\n        opinia: \"Bardzo polecam szko Pana Sawka. Bardzo ciekawe zajcia z teorii, prowadzone pene pasji. Jazdy przebiegy w miej atmosferze, bez dodatkowego stresu, kady z instruktor\\xf3w zwr\\xf3ci uwag na bdy, kt\\xf3re mona w szybki spos\\xf3b skorygowa. Instruktorzy w bardzo fajny spos\\xf3b ucz a przy tym rozwiej kad wtpliwo jak moemy mie podczas jazd. Dziki Panu Sawkowi kt\\xf3ry przygotowywa mnie do jazd kr\\xf3tko przed egzaminem udao mi si zda i czuj si pewnie zacz jazd ju jako penoprawny kierowca. Jeszcze raz dzikuj wszystkim instruktorom za wsparcie i solidn nauk. Jeeli kto chce zacz nauk jazdy to z pewnoci moecie wybra t szko i nie bdziecie zawiedzeni.\"\n    },\n    {\n        name: \"Angelika\",\n        stars: 5,\n        opinia: \"Polecam z czystym sumieniem. Po 6 latach przerwy ponownie zapisaam si na kurs prawa jazdy. Przeamaam sw\\xf3j lk zwizany z prowadzeniem auta. W szczeg\\xf3lnoci chciaabym podzikowa Panu Sawkowi i Panu Maciejowi, z kt\\xf3rymi najczciej miaam przyjemno pokonywa kolejne kilometry. Bardzo dzikuj kademu instruktorowi za profesjonalne i indywidualne podejcie. Dziki temu udao si zda teori i praktyk za pierwszym razem. Do zobaczenia na drodze!\"\n    },\n    {\n        name: \"Suzan\",\n        stars: 5,\n        opinia: \"Najlepsza szkoa!!! Wykady prowadzone przez wspaniaego Pana Sawka, kt\\xf3ry swoj wiedz zaraa innych. Jazdy prowadzone w przyjemnej atmosferze, przez profesjonalnych instruktor\\xf3w, kt\\xf3rzy nawet po raz 100 powt\\xf3rz lub wytumacz zagadnienie, kt\\xf3re sprawia problemy. Problemy organizacyjne nie istniej dziki zaangaowaniu Oli, kt\\xf3ra zawsze wszystko dopina na ostatni guzik. Indywidualne podejcie do kursanta, sprawia, e stres zwizany z egzaminem znika, poniewa czujesz si dobrze przygotowany. Bardzo dzikuje wszystkim za cierpliwo, spok\\xf3j i pomoc w zdaniu egzaminu zar\\xf3wno teoretycznego jak i praktycznego.\"\n    },\n    {\n        name: \"Zofia\",\n        stars: 5,\n        opinia: \"wietne przygotowanie, peen profesjonalizm i super atmosfera!! teoria zdana za pierwszym, praktyka za drugim\\uD83D\\uDE01 cala kadra instruktorska na jazdach dawaa z siebie 101%, ale szczeg\\xf3lne podzikowania chciaabym zoy Panu Maciejowi, kt\\xf3ry za kadym razem wytrzymywa moje narzekanie, ale przede wszystkim doda mi pewnoci siebie na drodze! z caego serca polecam auto-s i z pewnoci mog przyzna, e nie mogam wybra lepszej szkoy jazdy, dzikuje.\"\n    },\n    {\n        name: \"Anastasiya\",\n        stars: 5,\n        opinia: \"Bardzo polecam t szko jazdy! Indywidualne podejcie do kadego kursanta. Instruktorzy tumacz wszystko w spos\\xf3b zrozumiay, nie tylko wedug ksikowych definicji, ale z uwzgldnieniem praktyki yciowej, co naprawd pomaga w trakcie jazdy(osobliwe Pan Sawomir).Zawsze mona dogada si z instruktorem co do dogodnego terminu zaj, co nie jest moliwe w kadej szkole. Do tego bardzo przyjazne, ludzkie podejcie. Polecam wszystkim!\"\n    },\n    {\n        name: \"Micha\",\n        stars: 5,\n        opinia: \"Bardzo dobra szkoa jazdy. Podczas kursu zauwayem bardzo yciowe podejcie do nauki, a nie na zasadzie odklepa zarobi. Poza tym maj wasny plac manewrowy, znaj dobre miejsca do nauki w Poznaniu i okolicach, ucz jazdy na autostradzie, na automatycznej skrzyni i najwaniejsze maj dobr kadr instruktorsk. Jak m\\xf3j modszy brat bdzie m\\xf3g zacz kurs prawa jazdy to mu ich polec.\"\n    },\n    {\n        name: \"Basia\",\n        stars: 5,\n        opinia: \"Bardzo si ciesz, e wybraam AUTO-S, wykady z panem Sawkiem byy bardzo ciekawe i zawsze chodziam z przyjemnoci, pan Maciej, z kt\\xf3rym najczciej miaam jazdy jest wietnym instruktorem. Nauczy mnie dobrze jedzi i jazdy zawsze byy w miej, swobodnej atmosferze. Baardzo polecam t szko\"\n    },\n    {\n        name: \"Tobiasz\",\n        stars: 5,\n        opinia: \"Najlepsza szkoa jazdy:) Kady element na najwyszym poziomie, Auto-S jest bardzo nowoczesne, ma wietny internetowy system zapis\\xf3w na jazdy, super przygotowan ciek zada i rozwizania przygotowujce do dobrej i praktycznej jazdy po egzaminie. Pan Sawek wietnie prowadzi wykady, a przez cay czas trwania kursu czu jego opiek. Instruktorzy s naprawd super, sympatyczni, pomocni i bardzo dobrze przekazuj wiedz. Dziki temu wszystkiemu, kady egzamin udao zda si za pierwszy razem. Polecam z caego serca!\"\n    },\n    {\n        name: \"Dominik\",\n        stars: 5,\n        opinia: \"Najlepsza szkoa na jak mogem trafi! Przez pierwszy miesic wykady, kt\\xf3re wietnie prowadzi Pan Sawek na najwyszym poziome, zero stresu wietna atmosfera i wiedza kt\\xf3r Pan Sawek przekazuje to co piknego. Same jazdy te wietnie zorganizowane, nie byo problemu z tym eby gdzie po mnie podjecha lub odebra z jakiego miejsca, gdy chciaem pojecha w jakie miejsce eby co powt\\xf3rzy/ jeszcze raz przewiczy to nie byo z tym adnego problemu i odrazu jechalimy w to miejsce, genialni instruktorzy kt\\xf3rzy potrafi wytumaczy wszystko, a atmosfera w aucie podczas jazd jeszcze lepsza przez co kade jazdy przebiegay wietnie, r\\xf3wnie Pani Ola dziki kt\\xf3rej bez problemu mona byo wszystko zaatwi i dziki tak zgranemu zespoowi cay kurs przebiega bezproblemowo i bardzo przyjemnie.\"\n    },\n    {\n        name: \"Sandra\",\n        stars: 5,\n        opinia: \"Bardzo polecam t szko jazdy, podczas zaj teoretycznych jak i praktycznych zawsze wszystko odbywao si bardzo profesjonalnie jak i miej atmosferze. Szczeg\\xf3lnie pozdrawiam Pan\\xf3w Roberta, Patryka i Macieja dziki kt\\xf3rym jazdy byy nie tylko nauk ale te czasem spdzonym w miym, kulturalnym towarzystwie. Pan Sawek jako waciciel orodka wychodzi do kursanta z wieloma moliwociami i unowoczenieniami kt\\xf3rych w innych szkoach nie znajdziemy, m.in. byam w pierwszej grupie kt\\xf3ra korzystaa z specjalnej cieki zada kt\\xf3ra pozwolia mi udoskonali moje umiejtnoci nie tylko na egzamin ale r\\xf3wnie na przyszo, polecam kademu\"\n    },\n    {\n        name: \"Sophia\",\n        stars: 5,\n        opinia: \"Szkoa Pana Sawka to najlepsza szkoa jazdy pod socem. Zajcia teoretyczne byy przeprowadzone w bardzo ciekawy spos\\xf3b. Wszystko byo jasno wyjanione, w razie wtpliwoci zawsze mona byo zapyta - nigdy nie byo z tym problemu. Same jazdy na pewno bd wspomina bardzo mile. Szczeg\\xf3lne podzikowania dla Pana Roberta - miaam z nim wikszo jazd i byo naprawd sympatycznie. Dostaam duo cennych rad, kt\\xf3re na pewno przydadz mi si w przyszoci. Bardzo dzikuje!!! Pan Sawek to rzetelna osoba na waciwym miejscu, zawsze zainteresowana losem kursanta\\uD83D\\uDE0D\"\n    },\n    {\n        name: \"Maciej\",\n        stars: 5,\n        opinia: \"wietna szkoa jazdy z profesjonalnym podejciem do kursant\\xf3w. Instruktorzy s cierpliwi, kompetentni i potrafi wszystko dokadnie wytumaczy, co sprawia, e nauka przebiega w przyjaznej atmosferze. Zajcia teoretyczne prowadzone w spos\\xf3b jasny i interesujcy. Dziki temu kursowi czuem si pewnie na egzaminie. Jeli kto szuka solidnej szkoy jazdy, to zdecydowanie polecam.\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./constants/reviews.js\n");

